import InstagramIcon from "@mui/icons-material/Instagram";
import ArrowOutwardIcon from '@mui/icons-material/ArrowOutward';

import RemoveIcon from '@mui/icons-material/Remove';

export const Data =
  " Open to building software apllications for Organization of  various sizes";

export const social = [
  {
    id: 1,
    url: "https://www.instagram.com/fabulous_jay/",
    icon: <ArrowOutwardIcon style={{fontSize:'24px'}}/>,
    text: 'LI' ,
    dash:<RemoveIcon style={{fontSize:'30px', display:'flex',  marginLeft:'16px'}}/>
  },
  {
    id: 2,
    url: "https://twitter.com/finallyfabulous",
    icon: <ArrowOutwardIcon style={{fontSize:'24px'}}/>,
    text: 'TW' ,
    dash:<RemoveIcon style={{fontSize:'30px', display:'flex',  marginLeft:'16px'}}/>
  },
  {
    id: 3,
    url: "https://github.com/fabulousjay001",
    icon: <ArrowOutwardIcon style={{fontSize:'24px'}}/>,
    dash:<RemoveIcon style={{fontSize:'30px', display:'flex',  marginLeft:'16px'}}/>,
    text: 'GT' ,
  },
  {
    id: 4,
    url: "https://www.instagram.com/fabulous_jay",
    icon: <ArrowOutwardIcon style={{fontSize:'24px'}}/>,
    dash:<RemoveIcon style={{fontSize:'30px', display:'flex', marginLeft:'16px'}}/>,
    text: 'IG' ,
  },
  {
    id: 5,
    url: "mailto:adegbuluayomiposi@gmail.com",
    icon: <ArrowOutwardIcon style={{fontSize:'24px'}}/>,
    text: 'EMAIL' ,
  },
];

export const profileText= 'Hello, I’m Ayo, a creative problem solver that help brands create and accessible interfaces that meet user needs.'
